import React from 'react';
import { useAppDispatch } from '../redux/hook';
import { addCart, addToCart } from '../redux/features/CartSlice';
import { AiFillStar, AiOutlineStar, AiOutlineShoppingCart } from 'react-icons/ai';
// import { toast } from 'react-toastify';
import bird from '../../assets/bird.jpg'
const ProductCard = ({ id, img, category, title, price }) => {
    const dispatch = useAppDispatch();

    const addProductToCart = () => {
        const payload = {
            id,
            img,
            title,
            price,
            quantity: 1,
        };


        dispatch(addCart(payload));
        // toast.success("Added to Cart");
    };

    return (
        <div className="border border-gray-200">
            <div className="text-center border-b border-gray-200">
<img src='data:image/jpeg;base64,'/>                
            </div>
            <div className="px-8 py-4">
                <p className="text-gray-500 text-[14px] font-medium">{category}</p>
                <h2 className="font-medium">{title}</h2>
                <div className="mt-3 flex items-center text-[#FFB21D]">
                    <AiFillStar />
                    <AiFillStar />
                    <AiFillStar />
                    <AiFillStar />
                    <AiOutlineStar />
                    <p className="text-gray-600 text-[14px] ml-2">(3 Review)</p>
                </div>
                <div className="flex justify-between items-center mt-4">
                    <h2 className="font-medium text-accent text-xl">${price}</h2>
                    <div
                        className="flex gap-2 items-center bg-pink text-white px-4 py-2 cursor-pointer hover:bg-accent"
                        onClick={addProductToCart}
                    >
                        <AiOutlineShoppingCart /> Add To Cart
                    </div>
                </div>
            </div>
        </div>
    );
}

export default ProductCard;
